import React from "react";

const AppRouter = () => {
    return (
        <Switch>
            <Route path="/about">
              <About/>
            </Route>
            <Route path="/posts">
              <Posts/>
            </Route>
            <Route path="/404">
              <Error/>
            </Route>
            <Redirect to="/404"/>
          </Switch>
    );
};

export default AppRouter
